import React from "react";

const MealTypeSearch = () => {
  const mealTypeArr = [
    "main course",
    "side dish",
    "dessert",
    "appetizer",
    "salad",
    "bread",
    "breakfast",
    "soup",
    "beverage",
    "sauce",
    "marinade",
    "fingerfood",
    "snack",
    "drink",
  ];
  return (
    <div className="col-6">
      <p className="searchBy">Meal Type</p>
      <p>Main course</p>
      <p>Side dish</p>
      <p>Dessert</p>
      <p>Salad</p>
    </div>
  );
};

export default MealTypeSearch;
